<item>
<title>2007-06-14 18:52:05</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaTechnicalStatistic/show&amp;time=2007-06-14+18%3A52%3A05</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaTechnicalStatistic&amp;amp;v=gmv" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Calls&amp;nbsp;Info&amp;nbsp;/&amp;nbsp;Форма&amp;nbsp;Technical&amp;nbsp;Statistic&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaTechnicalStatistic&amp;amp;time=2007-06-14+18%3A52%3A05">2007-06-14 18:52:05&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaTechnicalStatistic&amp;amp;time=2007-06-14+19%3A00%3A56">2007-06-14 19:00:56&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Позволяет выбрать для&amp;nbsp;просмотра конкретного оператора, от&amp;nbsp;которого пришли звонки.&lt;br />
Значение по&amp;nbsp;умолчанию: Any&amp;nbsp;(любые операторы). &lt;br />
Позволяет выбрать для&amp;nbsp;просмотра конкретного оператора, на&amp;nbsp;которого ушли звонки.&lt;br />
Значение по&amp;nbsp;умолчанию: Any&amp;nbsp;(любые операторы).&lt;br />
Период времени, за&amp;nbsp;который будут показаны звонки.&lt;br />
Может принимать следующие значения:&lt;br />
&lt;strong>Today&lt;/strong> – Сегодня.&lt;br />
&lt;strong>Yesterday&lt;/strong> – Вчера.&lt;br />
&lt;strong>3 days&lt;/strong> – Три&amp;nbsp;дня.&lt;br />
&lt;strong>7 days&lt;/strong> – Семь дней, не&amp;nbsp;включая текущий день.&lt;br />
&lt;strong>Month&lt;/strong> – Текущий месяц.&lt;br />
&lt;strong>Last month&lt;/strong> – Предыдущий месяц.&lt;br />
&lt;strong>Period&lt;/strong> – Период, заданный вручную полями From-To.&lt;br />
Значение по&amp;nbsp;умолчанию – today&lt;br />
Время начала и&amp;nbsp;конца выборки, будут анализироваться только звонки прошедшие в&amp;nbsp;указанный период времени.&lt;br />
Значение по&amp;nbsp;умолчанию: 00:00-24:00&lt;br />
Сдвиг часового пояса в&amp;nbsp;часах. Используется для&amp;nbsp;сдвига прошедших звонков при&amp;nbsp;сверке с&amp;nbsp;операторами.&lt;br />
Значение по&amp;nbsp;умолчанию: 0 часов.&lt;br />
Фильтр начальных цифр номера. Позволяет получить статистику по&amp;nbsp;звонкам прошедшим на&amp;nbsp;определенное направление.&lt;br />
Тип&amp;nbsp;требуемой статистики.&lt;br />
&lt;strong>Q931&lt;/strong> &amp;ndash; Статистика по&amp;nbsp;кодам завершения&lt;br />
&lt;strong>Src codec&lt;/strong> &amp;ndash; Статистика по&amp;nbsp;кодам оригинации&lt;br />
&lt;strong>Dst codec&lt;/strong> &amp;ndash; Статистика по&amp;nbsp;кодам терминации&lt;br />
&lt;strong>Elapsed time&lt;/strong>- Статистика показателей качества&lt;br />
Если используется несколько MVTS-серверов, можно получить данные, по&amp;nbsp;конкретному серверу, выбрав его&amp;nbsp;в&amp;nbsp;этом списке.&lt;/div>&lt;/div>
</description>
</item>
